script: |
  super -f text -I q5384.spq | sort > q5384.out

inputs:
  - name: q5384.spq
    data: |
      SELECT ALL - COUNT ( * ) FROM tab2 (FORMAT parquet) AS cor0 WHERE 11 NOT IN ( 51, col0 + 31 + + col1 - - col1 + + 56 + - ( col0 ) - + col1 / - + ( - col2 ) );
  - name: tab2

outputs:
  - name: q5384.out
    data: |
      -3
